import React, { Component } from 'react'
import './index.css'

export default class Header extends Component {
    render() {
        
        handleUp = (event) => {
            console.log(event);
        }

        return (
            <div className="todo-header">
                <input onKeyUp={this.handleUp()} type="text" placeholder="请输入你的任务名称，按回车键确认"/>
            </div>
        )
    }
}
